import React,{ Component } from 'react';
import "./Hello.css";
import Logo from './images/logo.png'

class Hello extends Component {
    render() {
        return  ( <div>
            <div className='body1'>
                <img className='team' src={Logo} />
                <div className="body-text">
                    <h1 className='body-text1'>IEEE SPS</h1>
                    <p className='body-text2'>Signal Processing Society</p>

                </div>
                    
            </div>
        
         </div>   
        );
    }
}


